import React from 'react';
import Slelf from './Slelf';

const Shelves = () => {

    const currentlyReading = [];
    const wantToRead = [];
    const read = [];


    //Moving Methods?

    return(
        <div>
            <Slelf title="Currently Reading" books={currentlyReading}></Slelf>
            <Slelf title="Want to Read" books={wantToRead}></Slelf>
            <Slelf title="Read" books={read}></Slelf>
            
        </div>
         
    )



}
export default Shelves;
